.wrapper{
    display: grid;
    grid-template-columns: minmax(10px, 1fr) minmax(min-content, 1410px) minmax(10px, 1fr);
    grid-template-rows: minmax(10px, 1fr) minmax(min-content, 1410px) minmax(10px, 1fr);
}

.pocetna{
    &__content{
        grid-column: 2 / 3;
        grid-row: 2 / 3;
    
        display: grid;
        grid-template-columns: 1fr;
        grid-template-rows: max-content 1fr max-content; 

        &-header{
            grid-column: 1;
            grid-row: 1;
        }
        
        &-mainContent{
            grid-column: 1;
            grid-row: 2 / 3;
        
            display: grid;
            grid-template-columns: 1fr;
            grid-template-rows: 1fr 1fr;
        
            .upperSection{
                grid-column: 1 / 2;
                grid-row: 1 / 2;
        
                display: grid;
            }
        
            .underSection{
                grid-column: 1;
                grid-row: 2 / -1;
        
                display: grid;
            }
        
            &--dottedBack, &--exes, &--lines, .slug, .btnOnama, .josLinkPocetna, .images{
                grid-column: 1;
                grid-row: 1 / -1;
            }
        }
        
        &-footer{
            grid-column: 1;
            grid-row: 3 / -1;
        }
    }
}

