.navigation {

    &__checkbox{
        display: none;
    }

    &__button{
        height: 6rem;
        width: 6rem;
        position: absolute;
        top: 2.5rem;
        right: 6rem;
        border-radius: .5rem;
        z-index: 200;
        text-align: center;
        cursor: pointer;

        @media only screen and (max-width: 900px){
            right: 2rem;
        }

        @media only screen and (max-width: 500px){
            right: 1.5rem;
        }
    }

    &__background{
        opacity: 0;
        height: 5rem;
        width: 5rem;
        background-color: black;
        border-radius: 1rem;
        position: fixed;
        top: 3rem;
        right: 6.5rem;
        z-index: 100;
        transition: all .8s cubic-bezier(0.86, 0, 0.07, 1);
    }

    &__nav{
        height: 100vh;
        position: fixed;
        top: 0;
        left: -20rem;
        z-index: 150;

        opacity: 0;
        width: 0;
        transition: all .8s cubic-bezier(0.68, -0.55, 0.265, 1.55);
    }

    &__list{
        position: absolute;
        top: 50%;
        left: 50%;
        transform: translate(-50%, -50%);
        list-style: none;
        text-align: center;
        width: 100%;
    }

    &__item{
        margin: 3rem;
    }

    &__link{
        &:link,
        &:visited {
            position: relative;
            font-size: 2.5rem;
            font-weight: 300;
            padding: 0.5rem 2rem;
            color: white;
            text-decoration: none;
            text-transform: uppercase;
        }

        &:after {
            content: "";
            position: absolute;
            bottom: -3px;
            left: 0;
            height: 3px;
            width: 0%;
            background: #1173A8;
            transition: width .3s ease 0s, left 0.3s ease 0s;
        }
        &:hover:after{
            width: 100%;
        }
    }

    // FUNCTIONALITY

    &__checkbox:checked ~ &__background {
        opacity: 1;
        transform: scale(60);
    }

    &__checkbox:checked ~ &__nav{
        opacity: 1;
        left: 0;
        width: 100%;
    }

    &__checkbox:checked ~ &__list{
        opacity: 1;
    }

    // ICON
    &__icon{
        position: relative;
        margin-top: 2.7rem;

        &,
        &::before,
        &::after {
            width: 4rem;
            height: 3px;
            border-radius: 3px;
            background-color: #1173A8;
            display: inline-block;
        }

        &::before,
        &::after {
            content: "";
            position: absolute;
            left: 0;
            transition: all .8s;
        }

        &::before { top: -1.1rem; }
        &::after { top: 1.1rem; }
    }


    &__checkbox:checked + &__button &__icon {
        background-color: transparent;
    }

    &__checkbox:checked + &__button &__icon::before {
        background-color: white;
        top: 0;
        transform: rotate(45deg);
    }

    &__checkbox:checked + &__button &__icon::after {
        background-color: white;
        top: 0;
        transform: rotate(-45deg);
    }
}

